            fontSize={"1rem"}
            fontWeight={400}
          >
            {Info.Description}
          </Typography>
        </CardContent>

        <Icon>{Info.image}</Icon>
        {/* <TelevisionIcon
          style={{
            position: "relative",
            width: 80,
            height: 80,
            marginLeft: "300px",
            marginTop: "100px",
          }}
        /> */}
      </Card>
    </>
  );
};

export default CustomCard;
